import React from "react";

const SearchBox = (props) => {
    const { handleSubmit } = props;
    const submit = (values) => { }
    return (
        <>
            <form onSubmit={(submit)}>
                <input
                    className="inputStyle"
                    type="text"
                    placeholder="Search for images here..."
                />
            </form>
        </>
    )
}

export default SearchBox;
